_parent.盾._visible = 1;
_parent.刚体 = true;
_parent.盾量 = _parent.hp满血值 * 0.1;
_parent.防御力 = _parent.基础防御力 + _parent.基础防御力 * _parent.等级 / 100;
_parent.伤害类型 = "魔法";
_parent.魔法伤害属性 = "冲";
_parent.受击反制 = function(伤害量,子弹)
{
	if (this.盾量 <= 0)
	{
		this.盾._visible = 0;
		this.防御力 = this.基础防御力;
		this.伤害类型 = undefined;
		this.魔法伤害属性 = undefined;
		this.刚体 = false;
		this.受击反制 = false;
		return 伤害量;
	}
	else
	{
		this.盾量 -= 伤害量;
		附加层伤害 = 子弹.附加层伤害计算;
		if (附加层伤害)
		{
			this.盾量 -= 附加层伤害;
		}
		if (this.盾量 <= 0)
		{
			this.盾._visible = 0;
			this.防御力 = this.基础防御力;
			this.伤害类型 = undefined;
			this.魔法伤害属性 = undefined;
			this.刚体 = false;
			this.受击反制 = false;
		}
		return 0;
	}
};

