onClipEvent(enterFrame){
   _parent.攻击时四向移动(拔刀上速度,拔刀下速度,拔刀左速度,拔刀右速度);
}
onClipEvent(load){
	拔刀上速度 = 0;
	拔刀下速度 = 0;
	拔刀左速度 = 0;
	拔刀右速度 = 0;
	if(_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x>0){
		拔刀左速度 = (_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x)/6;
	}else{
		拔刀右速度 = (_root.gameworld[_parent._parent.攻击目标]._x - _parent._parent._x)/6;
	}
	if(_parent._parent._y - _root.gameworld[_parent._parent.攻击目标].Z轴坐标>0){
		拔刀上速度 = (_parent._parent._y - _root.gameworld[_parent._parent.攻击目标].Z轴坐标)/6;
	}else{
		拔刀下速度 = (_root.gameworld[_parent._parent.攻击目标].Z轴坐标 - _parent._parent._y)/6;
	}
}

//本帧是进行一定特殊曲线移动的帧，不具有太多参考价值

//你需要改的值
速度上限 = _parent.行走X速度 * 2;
追踪持续帧 = 7;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限);
速度Z = (速度X * 距离Z / 距离X ) * (10 + random(5)) / 10 ;
上下加速度 = 0;
左右加速度 = 0;

if (速度X >= 0)
{
	左速度 = 速度X;
}
else
{
	右速度 = -速度X;
}
if (速度Z >= 0)
{
	上速度 = 速度Z;
	上下加速度 = 速度Z * 0.5 / 追踪持续帧;
}
else
{
	下速度 = -速度Z;
	上下加速度 = -速度Z * 0.5 / 追踪持续帧;
}

