	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

//本帧是进行一定特殊曲线移动的帧，不具有太多参考价值

//你需要改的值
速度上限 = _parent.行走X速度 * 1.5;
追踪持续帧 = 3;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限) * (7 + random(5)) / 10;
速度Z = (速度X * 距离Z / 距离X ) * (7 + random(5)) / 10 ;
上下加速度 = 0;
左右加速度 = 0;

if (速度X >= 0)
{
	左速度 = 速度X;
	左右加速度 = -速度X * 0.5 / 追踪持续帧;
}
else
{
	右速度 = -速度X;
	左右加速度 = 速度X * 0.5 / 追踪持续帧;
}
if (速度Z >= 0)
{
	上速度 = 速度Z;
}
else
{
	下速度 = -速度Z;
}

