距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限) * (7 + random(5)) / 10;
速度Z = (速度X * 距离Z / 距离X ) * (7 + random(5)) / 10 ;
上下加速度 = 0;
左右加速度 = 0;

